import { Col, Row, Form, Input, Button } from "antd";

const Order = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        paddingTop: "4rem",
        backgroundColor: "#eee",
      }}
    >
      <div
        style={{
          width: "100%",
          maxWidth: "850px",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginBottom: "2rem",
          }}
        >
          <h3>PLACE AN ORDER</h3>
        </div>

        <Row style={{height:"100%", marginBottom:"3rem"}} gutter={16}>
          <Col style={{backgroundColor:"#fff", padding:"1rem"}} span={12} offset={6}>
            <Form
              //form={form}
              layout="vertical"
            >
              <Form.Item
                label="Required Mark"
                name="requiredMarkValue"
              >
                <Input placeholder="Raivaussiivous osoite" />
              </Form.Item>
              <Form.Item
                label="Description/Viesti"
                required
                tooltip="This is a required field"
              >
                <Input.TextArea rows={3} placeholder="Huomio/ViestikenttÃ¤" />
              </Form.Item>
              <Button type="primary">Submit</Button>
            </Form>
          </Col>
        </Row>
      </div>
    </div>
  );
};

export default Order;
